import React from 'react';
import ReactDom from 'react-dom';
import "./index"

let name='satish';
let img1='https://picsum.photos/seed/picsum/200/300';
let img2='https://picsum.photos/200/300?grayscale';
let img3='https://picsum.photos/200/300/?blur';
let links='https://www.youtube.com/';

ReactDom.render(
  <>
  <h1 class='heading'>hello my name is {name}</h1>
  <img src={img1} />
  <img src={img2} />
  <a href={links} target='_a'>
  <img src={img3} />
  </a>

  </>,
  document.getElementById('root')
);
